import {useEffect, useRef} from "react";

function Empty(){
    const EmptyRef = useRef(null);

    useEffect(() => {
        const EmptyElement = EmptyRef.current;
        if (EmptyElement) {
            const width = EmptyElement.offsetWidth;
            console.log("Размер Empty:", width);
        }
    }, []);
    return (
        <div ref={EmptyRef}> </div>
    )
}

export default Empty
